package xiaolong.baidu.libs;

import java.io.UnsupportedEncodingException;
import java.util.ArrayList;
import java.util.HashMap;
import java.util.regex.Matcher;
import java.util.regex.Pattern;

public class BaiduIndexEncoder {
	
	public BaiduIndexEncoder(){
		
	}

	private String BASE64_CHARS = "ABCDEFGHIJKLMNOPQRSTUVWXYZabcdefghijklmnopqrstuvwxyz0123456789+/=";

	private String flashName = "";

	private int rand = 0;

	public String getBaiduIndex(String fileName, String sourceKey) {
		if (!fileName.equals(flashName)) {
			testRand(sourceKey);
			flashName = fileName;
		}
		String baiduIndex = decodeToByteArrayB(Decode(sourceKey, this.rand));

		return baiduIndex;
	}

	private void testRand(String sourceKey) {
		String process1 = "", process2 = "";

		for (int i = 0; i < 999; i++) {
			process1 = Decode(sourceKey, i);
			if (process1.length() == 0){
				break;
			}
			try {
				process2 = decodeToByteArrayB(process1);
				if (process2.length() == 0) {
					break;
				}

				Pattern pattern = Pattern.compile("[0-9,]+");
				Matcher ma = pattern.matcher(process2.substring(0, 9));
				if (ma.find()) {
					if (ma.group().length() == 9) {
						this.rand = i;
						break;
					}
				}
			} catch (Exception e) {
			}
		}

	}

	private String decodeToByteArrayB(String sourceKey) {
		int _loc_6 = 0;
		int keyIndex = 0;
		ArrayList<Integer> result = new ArrayList<Integer>();
		int[] _loc_3 = new int[4];
		int[] keyArray = new int[3];
		int _loc_5 = 0;
		while (_loc_5 < sourceKey.length()) {
			_loc_6 = 0;
			while (_loc_6 < 4 && _loc_5 + _loc_6 < sourceKey.length()) {
				_loc_3[_loc_6] = BASE64_CHARS.indexOf(sourceKey.charAt(_loc_5 + _loc_6));
				while (_loc_3[_loc_6] < 0 && _loc_5 < sourceKey.length()) {
					_loc_5 = _loc_5 + 1;
					_loc_3[_loc_6] = BASE64_CHARS.indexOf(sourceKey.charAt(_loc_5 + _loc_6));
				}
				_loc_6 = _loc_6 + 1;
			}
			keyArray[0] = (_loc_3[0] << 2) + ((_loc_3[1] & 48) >> 4);
			keyArray[1] = ((_loc_3[1] & 15) << 4) + ((_loc_3[2] & 60) >> 2);
			keyArray[2] = ((_loc_3[2] & 3) << 6) + _loc_3[3];
			keyIndex = 0;
			while (keyIndex < keyArray.length) {
				if (_loc_3[(keyIndex + 1)] == 64) {
					break;
				}
				result.add(keyArray[keyIndex]);

				keyIndex = keyIndex + 1;
			}
			_loc_5 = _loc_5 + 4;
		}
		int resultCount = result.size();
		byte[] ibyte = new byte[resultCount];
		for (int i = 0; i < resultCount; i++) {
			Object object = result.get(i);
			ibyte[i] = Byte.parseByte(object.toString());
		}

		String resultString = "";
		try {
			resultString = new String(ibyte, "utf-8");
		} catch (UnsupportedEncodingException e) {
			resultString = "";
		}
		return resultString;
	}

	private String Decode(String sourceKey, int key) {
		HashMap<Character, Character> cache = new HashMap<Character, Character>();

		int _loc_3 = 0;
		int b64Len = 0;

		if (cache.size() == 0) {
			cache = new HashMap<Character, Character>();
			b64Len = BASE64_CHARS.length();
			while (b64Len-- > 0) {
				cache.put(BASE64_CHARS.charAt(b64Len), BASE64_CHARS.charAt(b64Len));
			}
		}
		if (sourceKey.length() % 2 != 0) {
			return "";
		}
		int _loc_5 = sourceKey.length() >> 1;
			char[] _loc_6 = new char[_loc_5];
			String resultString = "";
			while (_loc_5-- > 0) {
				char k1 = sourceKey.charAt(_loc_5 * 2);
				char k2 = sourceKey.charAt(_loc_5 * 2 + 1);
				String temp = "";
				temp = String.valueOf(k1) + String.valueOf(k2);

				_loc_3 = Integer.valueOf(temp, 16) ^ key;
				if (cache.containsKey((char) _loc_3)) {
					_loc_6[_loc_5] = (char) _loc_3;
				}
			}
			resultString = String.valueOf(_loc_6);

			return resultString;
	}

	public void setFlashName(String flashName) {
		this.flashName = flashName;
	}

	public String getFlashName() {
		return this.flashName;
	}

	
	public static void main(String[] args) {
		String testKey1 = "";

		System.out.println(new BaiduIndexEncoder().getBaiduIndex("1", testKey1));

	}
}